import React from "react";
import ReactDOM from "react-dom";
import "./index.css";



class App extends React.Component {
  state = {
    inputValue: "bbb",
    filter: "all",
  };

  render() {

    return (

      <div>
        {this.state.inputValue}
      </div>
    );
  }
}

const rootElement = document.getElementById("root");
ReactDOM.render(<App />, rootElement);
